import React, { Component } from 'react';
import { useRef } from 'react';
import { FaBars, FaTimes } from "react-icons/fa"

function Navbar() {
    const navRef = useRef();

    const showNavBar = () => {
        navRef.current.classList.toggle("responseive_nav"
        );
    }

    return (
        <header>
            <h3>Logo</h3>
            <nav>
                <a href='/about'>About</a>
                <a href='/resorts'>Resorts</a>
                <button>
                    <FaTimes />
                </button>
            </nav>
            <button>
                <FaBars />
            </button>
        </header>
    )
};

export default Navbar;
